export default function Inventory() {

  var user=localStorage.getItem("user");
  user=JSON.parse(user);

  return (
    <div>
        Distributor's Name: {user.fname} {user.lname} <br></br><br></br>
        Milk available: {user.litres} <br></br> <br></br>
    </div>
  );
}
